import React from "react";
import NavBar from "../components/Navbar";
import Header from "../components/Header";
import Products from "../components/Products";
import Footer from "../components/Footer";

const Home = () => {
  return (
    <>
      <Header />
      <Products />
      <Footer />
    </>
  );
};

export default Home;
